    /* Annoying Features I never asked for */
    /* You Might Like div */
    div.r-vacyoi > div:nth-child(3),

    /* uhhh ???? */
    div.r-vacyoi:nth-child(4) > div,

    /* What's happening div */
    div.r-kemksi:nth-child(4),

    /* Who to Follow div */
    div.r-kemksi:nth-child(5),

