    /* Communities */
    a.css-175oi2r:nth-child(7),

    /* Premium XD */
    a.css-175oi2r:nth-child(8),

    /* Verified Orgies */
    a.css-175oi2r:nth-child(9),

    /* More Button */
    button.css-175oi2r:nth-child(10),
    button.css-175oi2r:nth-child(11),

    /* Big Whit Post */
    a.r-1fkl15p {
        display: none !important
    }
}

/* ==UserStyle==
@name           FilterGram
@namespace      github.com/openstyles/stylus
@version        1.0.0
@description    Filter annoyinh features of instagram
@author         ZuckBanger69
==/UserStyle== */
@-moz-document domain("www.instagram.com") {
    /* Suggested for you right split */
    div.x3hkoc4,

    /* Navbar*/
    /* Reels */
    div.x1xgvd2v > div:nth-child(2) > div:nth-child(4),

    /* Create */
    div.x1xgvd2v > div:nth-child(2) > div:nth-child(7),

    /* AI Studio and Threads*/
    .x1azxncr > div:nth-child(1),
    .x1azxncr > span:nth-child(2) {
        display: none !important
    }

    /* Align Content to middle after removing Right Split*/
    div.x10o80wk {
        width: 100% !important
    }

    /* OnlyPosts */
    div.x972fbf:nth-child(2) {
        display: none !important
    }
}
@-moz-document url-prefix("https://www.instagram.com/direct/") {
    div.x10o80wk {
        width: auto !important
    }
    .x1v4esvl.x1v4esvl {
        width: calc(100% - var(--nav-narrow-width)) !important
    }
}

