/* ==UserStyle==
@name           www.youtube.com/watch
@namespace      github.com/openstyles/stylus
@version        1.0.0
@description    A new userstyle
@author         Me
==/UserStyle== */

html,
    body,
    #content,
    ytd-app,
    ytd-masthead #container,
    ytd-rich-grid-renderer #chips,
    ytd-guide-renderer {
        --yt-spec-base-background: #000000 !important;
        background-color: #000000 !important
    }

html, body, main, .Box-sc-g0xbh4-0, .color-bg-default, .hide-sm {
    background-color: #000000 !important
}

header, .Box, .ContributionCalendar-day[data-level="0"] {
    background-color: #070707 !important    
}

@media (prefers-color-scheme: dark) {
      [data-color-mode="auto"][data-dark-theme="dark"], [data-color-mode="auto"][data-dark-theme="dark"] ::backdrop {
        --bgColor-default: #000000;
        --bgColor-muted: #171717;
    }
}

html, body {
    background-color: #000;
}

.bg-token-bg-elevated-secondary {
    background-color: #0f0f0f;
}

@layer base {
    .dark {
        --main-surface-primary: #000000;
        --sidebar-surface-primary: #0f0f0f;
        --message-surface: #0f0f0f
    }
}

@layer utilities {
  .dark\:bg-\[\#303030\]:is(.dark *) {
    background-color: #171717;
  }
}

@layer utilities {
  .dark\:bg-token-main-surface-secondary:is(.dark *) {
    background-color: #0f0f0f;
  }
}

.markdown hr {
    background-color: #171717;
}

markdown tr:not(:last-child) td,
markdown tr:not(:last-child) td {
  border-color: #fff;
}

@layer base {
  *, ::backdrop, ::after, ::before {
    border-color: #474747;
  }
}
